import React from "react";

const Recipes = ({ Recipes }) => {
   return (
      <div className="p-5 mt-5 d-flex flex-wrap">
         {Recipes.map((recipe) => (
            <>
               <div className="col-md-3 col-12 mb-md-5 mb-3">
                  <div classNa="card">
                     <img
                        src={recipe.recipe.image}
                        classNa="card-img-top"
                        alt="..."
                     />
                     <div classNa="card-body">
                        <h5 classNa="card-title">{recipe.recipe.label}</h5>
                     </div>
                  </div>{" "}
                  <ul classNa="list-group list-group-flush">
                     {recipe.recipe.ingredientLines.map((ingridient) => (
                        <>
                           <li classNa="list-group-item">{ingridient}</li>
                        </>
                     ))}
                  </ul>
               </div>
            </>
         ))}
      </div>
   );
};
export default Recipes;
